import './App.css';

async function App() {
  const getFeeds = async () => {
    const feeds = await fetch('http://127.0.0.1:5002/api/v1/feeds', {
      method: 'GET',
      headers: {'Content-Type': 'application/json'},
      //body: JSON.stringify(body)
    }).then(res => res.json())

    console.log(feeds)
  }

  return (
    <div className="App">
